I see this more often than I would like, people make grandiose promises, promises of a future together, things we‚Äôll do together, the places we will go..... As time passes none of it seems to materialize, in fact that same person might conveniently ‚Äòforget‚Äô they ever made the promise to begin with. Worst of all are the ones who when confronted get all twisted up in their ego, stuttering to find the words of excuse because you caught them in a pattern.  You caught them in their game. 

If you come across someone who jumps at the opportunity to promise this and that, be very mindful. Ask yourself, what do they want in the present? A lot of emotionally unavailable people will use these tactics to secure an attachment with you. They‚Äôll talk a big game, they‚Äôll promise you the world and the stars because they need you to invest in a fictitious future so they can get something from you right now. They love to see this enchanted idea of themselves in your eyes; they love the pedestal that you have put them on as a result of their empty promises; they love what you give to them in the now as a result of this future investment. All the while avoiding the painful reality of their self delusion, and avoiding the shadows in themselves that need healing. 

In the words of a wise one I know, ‚ÄúBe impeccable with your word. If you‚Äôre gonna talk about it, be about it; don‚Äôt just speak things that sound pretty because you want to appear some type of way.‚Äù

I pray that we all face our shit with strength and honesty so that we CAN be about our word. Once we are whole within ourselves we don‚Äôt need outside validation for future what-ifs, instead we can gift our time and energy out of an overflowing abundance just because we want to create even more beauty in the world. üôè‚ô•Ô∏è

